import matplotlib.pyplot as plt

def plot_coordinates(*coordinate_sets):
    for coordinates in coordinate_sets:
        x_coordinates, y_coordinates = zip(*coordinates)
        plt.plot(x_coordinates, y_coordinates, marker='o', linestyle='-')

    plt.title('Graph of Coordinates')
    plt.xlabel('X-axis')
    plt.ylabel('Y-axis')
    plt.grid(True)
    plt.legend(['Set 1', 'Set 2'])  # Adjust legend labels as needed
    plt.show()

